    welfare_rule_mul_lang = {
        [1] = {
            rule0 = [[1、星辉礼盒：使用1个星辉暗语，可开启1次，有机会获得@cfa7a0f星辉皮肤兑换券@n。*n2、筑梦礼盒：使用1个筑梦暗语，可开启1次，有机会获得@cfa7a0f筑梦皮肤兑换券@n。*n3、星辉皮肤兑换、筑梦皮肤兑换券可在兑换商店兑换专属皮肤，兑换商店会不定期更新，兑换券数量不清零。*n4、累计开启礼盒次数达到指定数量时，还可领取额外奖励，@cfa7a0f累计次数和奖励均会在每周一0点（GMT+8）重置@n，请及时领取奖励。*n5、每开启礼盒一次，均会增加一定数量的幸运值，幸运值越高，获得兑换券的机会就越大，当幸运值满时，下次开启礼盒必能获得一个兑换券，获得兑换券后，幸运值会重置为0后重新累计。*n6、账户中有星辉/筑梦暗语时，开启礼盒将会优先扣除星辉/筑梦暗语。*n7、筑梦暗语可通过花费20迷你币获得；也可以使用迷你币直接开启礼盒，连开5次有折扣，仅需花费88迷你币；@cfa7a0f每日首次花费迷你币开启筑梦礼盒免费，第二次半价@n，第三次起恢复原价。*n8、星辉暗语可通过花费68迷你币获得，也可以使用迷你币直接开启礼盒，连开5次有折扣，仅需花费318迷你币。*n9、星辉礼盒奖励列表和概率*n装扮/定制（永久） 4.799%*n装扮/定制（限时） 51.2%*n装扮碎片15%*n迷你币 6%*n迷你豆 10%*n道具 8%*n星辉皮肤兑换券 初始概率0.001%，幸运值越高概率越高，幸运值满必得*n10、筑梦礼盒奖励列表和概率*n装扮/定制（永久） 5.102%*n装扮/定制（限时） 58.297%*n装扮碎片 13%*n迷你币 2.6%*n迷你豆 10%*n道具 11%*n筑梦皮肤兑换券 初始概率0.001%，幸运值越高概率越高，幸运值满必得。*n 此为机会中奖商品，消费者购买或参与活动不代表即可获得特定商品]],
            rule13 = [[1. Starlight Geschenkbox: ein Stern-Code kann verwendet werden, und es kann einmal geöffnet werden, und es gibt eine Chance, @cfa7a0fStarlight Skin Umtauschgutschein@n zu erhalten.*n2. Traumbau-Geschenkbox: Verwenden Sie einen Gashapon Ticket, der einmal geöffnet werden kann, und haben Sie die Möglichkeit, @cfa7a0fTraumgebäude-Skin-Coupon@n zu erhalten.*n3. Starlight Skin Umtauschgutschein und Traumgebäude-Skin-Coupon können ihren exklusiven Skin im Tauschshop umtauschen. Der Tauschshop aktualisiert ihn von Zeit zu Zeit, und die Anzahl der Tauschcoupons wird nicht gelöscht.*n4. Wenn die kumulative Anzahl der sich öffnenden Geschenkboxen die angegebene Anzahl erreicht, können Sie auch zusätzliche Prämien erhalten.@cfa7a0f Die kumulative Anzahl und Prämien werden jeden Montag auf 0:00 (GMT-8) zurückgesetzt@n. Bitte erhalten Sie die Prämien rechtzeitig.*n5.Jedes Mal, wenn die Geschenkbox geöffnet wird, wird eine bestimmte Anzahl von Glückswerten hinzugefügt. Je höher der Glückswert, desto größer die Chance, den Tauschcoupon zu erhalten. Wenn der Glückswert voll ist, können Sie einen Tauschcoupon beim nächsten Öffnen der Geschenkbox erhalten. Nach Erhalt des Tauschcoupons wird der Glückswert auf 0 zurückgesetzt und wieder angesammelt.*n6. Wenn Stern-Code/Gashapon Ticket auf dem Konto ist, wird Stern-Code/Gashapon Ticket bevorzugt beim Öffnen der Geschenkbox abgezogen.*n7. Gashapon Ticket kann durch Ausgaben von 20s erhalten werden; Sie können die Geschenkbox auch direkt mit Minimünze öffnen. Es gibt einen Rabatt für fünf aufeinanderfolgende Male, und es werden nur 88Minimünze benötigt@cfa7a0f Es ist kostenlos, die Traumbau Geschenkbox mit Mini-Münze jeden Tag zum ersten Mal zu öffnen, zum zweiten Mal zum halben Preis @n, und der ursprüngliche Preis wird vom dritten Mal wiederhergestellt.*n8.Stern-Code erhalten Sie, indem Sie 68Minimünze ausgeben, oder Sie können Minimünze verwenden, um die Geschenkbox direkt zu öffnen. Es gibt einen Rabatt für fünf aufeinanderfolgende Male, nur 318Minimünze.*n9.Starlight Geschenkbox Belohnungsliste und Wahrscheinlichkeit*n dress up nach Maß (permanent) 4.799%*n kleiden sich hoch und Anpassung (begrenzte Zeit) 51.2%*n dress up fragments 15%*n Minimünze 6%*n Mini Bohnen 10%*n Requisiten 8%*n Die Anfangswahrscheinlichkeit von Starlight Skin Umtauschgutschein beträgt 0.001%. Je höher der Glückswert, desto höher die Wahrscheinlichkeit. Der Glückswert muss ermittelt werden*n10.Traumbau-Geschenkbox Belohnungsliste und Wahrscheinlichkeit*n dress up nach Maß (permanent) 5.102%*n dress up und Anpassung (begrenzte Zeit) 58.297%*n Anziehfragmente 13%*n Minimünze 2.6%*n Mini Bohnen 10%*n Requisiten 11%*n Traumgebäude-Skin-Coupon Anfangswahrscheinlichkeit ist 0.001%, je höher der Glückswert, desto höher die Wahrscheinlichkeit, und der Glückswert muss erhalten werden *n Dies ist ein Produkt, das Chancen gewinnt, und der Kauf oder die Teilnahme der Verbraucher an der Aktivität bedeutet nicht, dass sie ein bestimmtes Produkt erhalten können]],
            rule_id = 1,
            rule8 = [[1 ، ستاربكس هدية مربع : استخدام ستاربكس كلمة السر ، يمكن أن تفتح مرة واحدة ، لديك الفرصة للحصول على @ cfa7aaf ستاربكس الجلد قسيمة الصرف .n*2 ، حلم بناء هدية مربع : استخدام حلم بناء كلمة السر ، يمكنك فتح مرة واحدة ، لديك الفرصة للحصول على @cfa7a0f حلم بناء الجلد تبادل القسيمة @n ن . 3*n ، ستار تبادل الجلد ، حلم بناء الجلد تبادل القسائم يمكن تبادلها في متجر تبادل الجلد الحصري ، تبادل المتجر سوف يتم تحديثها بشكل غير منتظم ، عدد من تبادل القسائم ليست واضحة . 4*n التراكمي فتح عدد من الهدايا إلى عدد معين ، يمكنك أيضا الحصول على مكافآت إضافية ، @ cfa7aaf التراكمي مرات والمكافآت في الأسبوع 10 نقطة ( بتوقيت جرينتش + 8 ) إعادة تعيين @n ، يرجى الحصول على مكافآت في الوقت المناسب .5*n ، في كل مرة فتح هدية مربع ، وسوف تزيد من عدد معين من قيمة الحظ ، وارتفاع قيمة الحظ ، فرصة أكبر للحصول على قسيمة الصرف ، عندما تكون قيمة الحظ الكامل ، في المرة القادمة فتح هدية مربع سوف تكون قادرة على الحصول على قسيمة الصرف ، بعد الحصول على قسيمة الصرف ، قيمة الحظ سيتم إعادة تعيين إلى 0 بعد تراكم . رقم 6*n ، عندما يكون هناك ستاربكس / حلم بناء كلمة السر في الحساب ، سيتم خصم ستاربكس / حلم بناء كلمة السر قبل فتح هدية مربع . 7*n ، حلم كلمة السر يمكن الحصول عليها عن طريق انفاق 20 عملة صغيرة . يمكنك أيضا فتح هدية مربع مع ميني المال مباشرة ، خصم 5 مرات على التوالي ، فقط 88 ميني المال ؛ @cfa7a0f تنفق كل يوم أول عملة صغيرة لفتح الحلم هدية مربع مجانا ، للمرة الثانية نصف السعر @n للمرة الثالثة منذ استعادة السعر الأصلي . 8*n ، ستار فاي كلمة السر يمكن الحصول عليها من خلال إنفاق 68 عملة صغيرة ، ويمكن أيضا استخدام عملة صغيرة لفتح هدية مربع مباشرة ، حتى فتح 5 مرات الخصم ، تحتاج فقط إلى إنفاق 318 عملة صغيرة . 9*n ، ستار فاي هدية مربع مكافأة قائمة واحتمال * ن اللباس / العرف ( دائم ) 4.799 ٪ * ن اللباس / العرف ( الوقت المحدد ) 51.2 في المائة * ن اللباس قطعة 15 في المائة * ن ميني عملة 6 ٪ * ن ميني الفول 10 ٪ * ن الدعائم 8 ٪ * ن ستار فاي الجلد تبادل قسيمة الاحتمال الأولي 0.001 في المائة ، وارتفاع احتمال قيمة الحظ ، يجب أن تكون القيمة الكاملة 10*n بناء حلم هدية مربع مكافأة قائمة واحتمال * ن اللباس / العرف ( دائم ) 5.102 ٪ * ن اللباس / العرف ( الوقت المحدد ) 58.297 ٪ * ن اللباس قطعة 13 ٪ * ن ميني عملة 2.6 في المائة * ن ميني الفول 10 ٪ * ن الدعائم 11 ٪ * ن بناء حلم الجلد تبادل قسيمة الاحتمال الأولي 0.001 في المائة ، وارتفاع احتمال قيمة الحظ ، يجب أن يكون كامل قيمة الحظ*n هذا هو فرصة للفوز بجائزة السلع ، والمستهلكين شراء أو المشاركة في أنشطة لا تمثل إمكانية الحصول على سلعة معينة]],
            rule6 = [[1. Coffret cadeau Starlight: un Code étoile peut être utilisé une fois pour obtenir @cfa7a0f Bon d'échange Starlight Skin@n.*n2. Boîte-cadeau de construction de rêve : 1 Gashapon ticket peut être activé une fois pour obtenir @cfa7a0f Coupons de réduction@n.*n3. Gg et Coupons de réduction peuvent échanger leurs peaux exclusives dans les magasins de change. Les magasins de change les mettront à jour de temps à autre et le nombre de bons de change ne sera pas réglé à zéro.*n4. Lorsque le nombre cumulatif de boîtes - cadeaux ouvertes atteint la quantité spécifiée, vous pouvez également recevoir une récompense supplémentaire. @cfa7a0f le nombre cumulatif de fois et la récompense seront réinitialisés à 0: 00 (GMT + 8) Chaque semaine@n. Veuillez recevoir la récompense en temps opportun.*n5. Chaque fois que la boîte - cadeau est ouverte, un certain nombre de valeurs chanceuses seront ajoutées. Plus la valeur chanceuse est élevée, plus la chance d'obtenir un bon d'échange est grande. Lorsque la valeur chanceuse est pleine, un bon d'échange sera obtenu la prochaine fois que la boîte - cadeau est ouverte. Après avoir obtenu le bon d'échange, la valeur chanceuse sera réinitialisée à 0 et accumulée à nouveau.*n6. Lorsqu'il y a Code étoile / Gashapon ticket dans le compte, l'ouverture de la boîte - cadeau entraînera une déduction préférentielle de Code étoile / Gashapon ticket.*n7. L'Gashapon ticket peut être obtenue en dépensant 20 Mini-pièce; Vous pouvez également ouvrir la Boîte cadeau directement en utilisant Mini-pièce. Il y a une réduction pour ouvrir la boîte 5 fois. Il ne coûte que 88 Mini-pièce; @cfa7a0f pour la première fois chaque jour pour ouvrir la Boîte cadeau de rêve avec mini - pièce gratuite, deuxième demi - prix@n, troisième retour au prix original.*n8. Code étoile peut être obtenu en dépensant 68 Mini-pièce ou en utilisant Mini-pièce pour ouvrir directement la Boîte cadeau. Il y a une réduction pour ouvrir 5 fois, seulement 318 Mini-pièce sont nécessaires.*n9. Liste des récompenses Coffret cadeau Starlight et *n9. Coffret cadeau Starlight liste des récompenses et probabilités*n dressing / Custom (permanent) 4.799%*n habiller / personnaliser (limité dans le temps) 51.2%*n parure 15%*n Mini-pièce 6%*n Mini beans 10%*n accessoires 8%*n Gg probabilité initiale 0.001%, plus la valeur chanceuse est élevée, plus la probabilité est élevée, plus la valeur chanceuse est pleine.*n10. liste des récompenses Boîte-cadeau de construction de rêve et probabilité* n habiller / personnaliser (permanent) 5.102%*n robe / personnalisation (limitée dans le temps) 58.297%*n play fragment 13%*n Mini-pièce 2.6%*n Mini beans 10%*n accessoires 11%*n HH probabilité initiale 0.001%, plus la valeur chanceuse est élevée, plus la probabilité est élevée, plus la valeur chanceuse est pleine.*n Il s'agit d'un produit gagnant d'opportunité et l'achat ou la participation d'un consommateur à une activité ne signifie pas qu'il peut obtenir un produit particulier.]],
            rule5 = [[1. Caixa de presente de estrela: Use 1 Sussurro da estrela para abri-lo uma vez e tenha a chance de obter @cfa7a0f cupom de resgate de skins de estrela@n. *n2. Caixa de presente de construção de sonhos: Use 1 Código de código de construção de sonhos para abri-lo uma vez e tenha a chance de obter @cfa7a0f cupom de resgate de skins de construção de sonhos@n. *n3. Cupom de resgate de skins de estrela e cupom de resgate de skins de construção de sonhos podem ser resgatados por skins exclusivas na loja de resgate, a loja de resgate será atualizada de tempos em tempos e o número de vales não será limpado . *n4. Quando o número cumulativo de caixas de presente abertas atingir o número especificado, você também poderá receber recompensas adicionais. @cfa7a0f O número cumulativo de vezes e recompensas será redefinido @n todas as segundas-feiras às 0:00 (GMT+8), por favor, reivindique as recompensas a tempo. *n5. Toda vez que a caixa de presente é aberta, uma certa quantia de valor da sorte será adicionada. Quanto maior o valor da sorte, maior a chance de obter um cupom de resgate. Quando o valor da sorte estiver cheio, da próxima vez a caixa de presente for aberto, será obtido um cupom de resgate. Após o recebimento do cupom, o valor da sorte será zerado e acumulado novamente. *n6. Quando houver Sussurro da estrela/Código de Construção dos Sonhos na conta, a abertura da caixa de presente dará prioridade à dedução de Sussurro da estrela/Código de Construção dos Sonhos. *n7. O Sussurro da estrela pode ser obtido gastando 20 Mini Moedas. Você também pode usar as Mini Moedas para abrir a caixa de presente diretamente, há um desconto para abrir 5 vezes seguidas e custa apenas 88 Mini Moedas. @ cfa7a0f 1ª vez dos todos os dias de abrir a caixa de presente da construção dos sonhos é grátis, a segunda metade do preço @n, a terceira vez para restaurar o preço original. *n8. Sussurro da estrela pode ser obtido gastando 68 Mini Moedas, ou você pode usar as Mini Moedas para abrir a caixa de presente diretamente. Há um desconto para abrir 5 vezes seguidas, e custa apenas 318 Mini Moedas. *n9. Lista de Recompensas e Probabilidade da Caixa de Presente de estrela*nSkin/avatar (Permanente) 4.799%*nSkin/avatar (Tempo Limitado) 51.2%*nFragmentos de skin 15%*nMini Moeda 6%*nMini Feijão 10% *n Item 8%*n A probabilidade inicial do cupom de resgate de skin de estrela é de 0.001%. Quanto maior o valor da sorte, maior a probabilidade. Se o valor da sorte estiver cheio, você receberá diretamente. *n10. A lista de recompensas da Caixa de Presente da Construção dos Sonhoss e a probabilidade*nSkin/avatar (permanente) 5.102%*nSkin/avatar (tempo limitado) 58.297%*nFragmentos de skin 13%*nMini Moeda 2.6%*nMini Feijão 10%*nItem 11%*nCupom de resgate de skins de construção de sonhos, a probabilidade inicial é de 0.001%, quanto maior o valor da sorte, maior a probabilidade. Se o valor da sorte estiver cheio, você receberá diretamente. *n Este é um produto que tem chance de ganhar, a compra ou participação do evento não significa que possa obter produtos específicos.]],
            rule7 = [[1、スターパック：1つのスターコードを使用して一度開くと、@cfa7a0fスタースキン交換券@nを取得するチャンスがあります。*n2、築夢パック：：1つの築夢コードを使用して一度開くと、@cfa7a0f築夢スキン交換券@nを取得するチャンスがあります。*n3、スタースキン交換券と築夢スキン交換券は、交換ストアで専用スキンと交換できます。交換ストアは随時更新され、交換券の数はクリアされません。*n4、パックを開く累積数が指定された数に達すると、追加の報酬を受け取ることもできます。@cfa7a0f累積回数と報酬は毎週月曜日の1:00にリセットされます@n、時間内に報酬を受け取ってください。*n5、パックを開けるたびに、一定の幸運値が加算されます。幸運値が高いほど、交換券を獲得できる可能性が高くなります。幸運値がいっぱいになると、次回にパックを開けたとき、必ず交換券を取得できます。その後、幸運値は0にリセットされ、再度累積されます。 *n6、アカウントにスター/築夢コードがある場合、パックを開くとスター/築夢コードが優先に使用されます。 *n7、築夢コードは、20枚のミニコインを使うことで取得できます。また、ミニコインを使用してパックを直接開くこともできます。5回連続で開くと割引があり、88枚のミニコインしかありません。@cfa7a0f毎日初回にミニコインを使用して築夢パックを開くのは無料、二回目は5割引@n、3回目は元の価格に戻します。*n8、スターコードは、68枚のミニコインを使用して取得するか、ミニコインを使用してパックを直接開くことができます。5回続けて開くと割引があり、318枚のミニコインしかかかりません。*n9、スターパックの報酬リストと確率*nスキン/アバター（永久） 4.799％*nスキン/アバター（期間限定） 51.2％*nスキンかけら 15％*nミニコイン 6％*nミニビーン 10％*nアイテム 8%*nスタースキン交換券 初期確率0.001％、幸運値が高いほど、確率は高くなります。幸運値は満タンになると必ずもらえます。*n10、築夢パックの報酬リストと確率*nスキン/アバター（永久） 5.102％*nスキン/アバター（期間限定）58.297％*nスキンかけら 13％*nミニコイン 2.6％*nミニビーン 10％*nアイテム 11%*n築夢スキン交換券 初期確率0.001％、幸運値が高いほど、確率は高くなります。幸運値は満タンになると必ずもらえます。*n この商品は当たるチャンスがある商品であり、消費者の購入またはイベントへの参加は、特定の商品を手に入れることを意味するものではありません]],
            rule9 = [[1.별빛 선물 상자: 스타 코드 1개를 사용하여 1회 오픈할 수 있으며 CC를 획득할 수 있는 기회가 있습니다.*n2.드림빌딩 선물상자: 꼬임 쿠폰 1개를 사용하여 1회 오픈 가능하며 @cfa7a0f드림빌딩 스킨쿠폰@n 를 획득할 수 있습니다.*n3. 별빛 피부 교환 바우처: 드림빌딩 스킨쿠폰 는 교환 상점에서 전속 피부를 교환할 수 있으며, 교환 상점은 비정기적으로 갱신되며, 교환권의 수량이 0이 되지 않습니다.*n4. 선물 상자 누적 오픈 횟수가 지정된 수량에 도달하면 추가 보상을 수령할 수 있습니다. @cfa7a0f 누적 횟수와 보상은 매주 월요일 0시(GMT+8)에 리셋됩니다@n, 적절한 시기에 보상을 수령하세요.*n5. 선물 상자를 열 때마다 일정 수량의 행운치가 증가합니다. 행운치가 높을수록 교환권을 획득할 기회가 커집니다. 행운치가 가득 차면 다음에 선물 상자를 열면 반드시 교환권을 획득할 수 있습니다. 교환권을 획득하면 행운치가 0으로 리셋되어 다시 누적됩니다.*n6. 계좌에 스타 코드/꼬임 쿠폰 가 있으면 선물 상자를 열면 스타 코드/꼬임 쿠폰 를 우선 공제합니다.*n7.꼬임 쿠폰 는 20미니코인 를 소비하여 획득할 수 있다.미니코인 를 사용하여 선물 상자를 직접 오픈할 수도 있고, 5회 연속 오픈 시 할인이 있으며, 88미니코인 만 소모하면 됩니다. @cfa7a0f 매일 첫 번째 미니 코인을 사용하여 축몽 선물 상자를 열면 무료, 두 번째 반값@n, 세 번째부터 원가를 회복합니다.*n8. 스타 코드 는 68미니코인 를 소비하여 획득할 수 있으며, 미니코인 를 사용하여 선물 상자를 직접 오픈할 수도 있으며, 5회 연속 오픈 시 할인되며, 318미니코인 만 소비하면 됩니다.*n9.별빛 선물 상자 보상 목록 및 확률*n 룩/사용자 정의(영구) 4.799%*n분장/맞춤형(한시) 51.2%*n 조각 꾸미기 15%*n 미니코인 6%*n 미니콩 10%*n 아이템 8%*n 별빛 피부 교환 바우처 초기 확률 0.001%, 행운치가 높을수록 확률이 높고, 행운치가 가득 차면 반드시 획득*n10. 드림빌딩 선물상자 보상 목록 및 확률*n 룩/사용자 정의(영구) 5.102%*n 분장/사용자 정의(한정) 58.297%*n 조각 꾸미기 13%*n 미니코인 2.6%*n 미니콩 10%*n 아이템 11%*n 드림빌딩 스킨쿠폰 초기 확률 0.001%, 행운치가 높을수록 확률이 높고, 행운치가 가득 차면 반드시 획득*n 이것은 기회 당첨 상품으로 소비자가 구매하거나 이벤트에 참여하면 특정 상품을 얻을 수 있는 것이 아니다]],
            rule2 = [[1、星輝禮盒：使用1個星輝暗語，可開啓1次，有機會獲得@cfa7a0f星輝皮膚兌換券@n。*n2、築夢禮盒：使用1個築夢暗語，可開啓1次，有機會獲得@cfa7a0f築夢皮膚兌換券@n。*n3、星輝皮膚兌換、築夢皮膚兌換券可在兌換商店兌換專屬皮膚，兌換商店會不定期更新，兌換券數量不清零。*n4、累計開啓禮盒次數達到指定數量時，還可領取額外獎勵，@cfa7a0f累計次數和獎勵均會在每週一0點（GMT+8）重置@n，請及時領取獎勵。*n5、每開啓禮盒一次，均會增加一定數量的幸運值，幸運值越高，獲得兌換券的機會就越大，當幸運值滿時，下次開啓禮盒必能獲得一個兌換券，獲得兌換券後，幸運值會重置為0後重新累計。*n6、賬戶中有星輝/築夢暗語時，開啓禮盒將會優先扣除星輝/築夢暗語。*n7、築夢暗語可通過花費20迷你幣獲得；也可以使用迷你幣直接開啓禮盒，連開5次有折扣，僅需花費88迷你幣；@cfa7a0f每日首次花費迷你幣開啓築夢禮盒免費，第二次半價@n，第三次起恢復原價。*n8、星輝暗語可通過花費68迷你幣獲得，也可以使用迷你幣直接開啓禮盒，連開5次有折扣，僅需花費318迷你幣。*n9、星輝禮盒獎勵列表和概率*n莓果繽紛（永久） 0.8%*n雪豹守護者（女）（永久） 0.8%*n雪豹守護者（男）（永久） 0.8%*n跳鼠兜帽（永久）0.8%*n科技城制服（永久）0.797%*n萌萌拍立得（永久）0.8%*n草莓醬 貝瑞（永久）0.002%*n莓果繽紛（7天）10%*n雪豹守護者（女）（7天） 10%*n雪豹守護者（男）（7天） 10%*n跳鼠兜帽（7天）8%*n科技城制服（7天）5%*n萌萌拍立得（7天）3%*n草莓醬 貝瑞（1天）5.2%*n裝扮碎片*10 5%*n裝扮碎片*20 10%*n裝扮碎片*30 5%*n迷你幣*28 4%*n迷你幣*68 2%*n迷你豆*288 2%*n迷你豆*388 5%*n迷你豆*588 3%*n大加密箱 5%*n小星星煙花 3%*n星輝皮膚兌換券 初始概率0.001%，幸運值越高概率越高，幸運值滿必得*n10、築夢禮盒獎勵列表和概率*n貓系少女頭飾（永久） 1.3%*n黃白之戀裙子（永久）1.3%*n休閒馬丁（永久）1.3%*n魅惑麗影（永久）0.8%*n明月幾時有（永久）0.8%*n火雞專家 托克（永久）0.002%*n貓系少女頭飾（7天）10%*n黃白之戀裙子（7天）10%*n休閒馬丁（7天）10.697%*n魅惑麗影（7天）10%*n明月幾時有（7天）10%*n火雞專家 托克（1天）7.6%*n裝扮碎片*5 4%*n裝扮碎片*10 5%*n裝扮碎片*15 4%*n迷你幣*8 1.8%*n迷你幣*18 0.8%*n迷你豆*150 2%*n迷你豆*300 5%*n迷你豆*500 3%*n一疊傳送捲軸 3%*n大加密箱 3%*n小星星煙花 5%*n築夢皮膚兌換券 初始概率0.001%，幸運值越高概率越高，幸運值滿必得。*n 此為機會中獎商品，消費者購買或參與活動不代表即可獲得特定商品]],
            rule10 = [[1. Hộp quà Tinh Huy: Dùng 1 Mật Ngữ Tinh Huy có thể mở 1 lần, có cơ hội nhận được@cfa7a0fVé đổi skin Tinh Huy@n. *n2. Hộp quà Trúc Mộng: Dùng 1 Mật Ngữ Trúc Mộng có thể mở 1 lần, có cơ hội nhận được@cfa7a0fVé đổi skin Trúc Mộng@n. *n3. Vé đổi skin Tinh Huy, Trúc Mộng có thể đổi lấy skin độc quyền ở Tiệm, Tiệm đổi sẽ được cập nhật thường xuyên, số lượng vé đổi sẽ không bị cài đặt lại. *n4. Khi tích lũy số lần mở hộp quà đạt đến số lượng nhất định, còn có thể nhận thêm thưởng khác, @cfa7a0f số lần tích lũy và thưởng đều sẽ được cài đặt lại vào 23h chủ nhật hàng tuần@n, nhớ nhận thưởng kịp thời nhé! *n5. Mở hộp quà mỗi lần sẽ tăng giá trị may mắn nhất định, giá trị may mắn càng cao, cơ hội nhận được vé đổi cũng càng lớn. Khi giá trị may mắn đã đầy, lần tiếp theo mở hộp quà chắc chắn sẽ nhận được 1 vé đổi, sau khi nhận vé đổi, giá trị may mắn sẽ cài đặt lại về 0 và bắt đầu tích lũy lại. *n6. Khi tài khoản có Mật Ngữ Tinh Huy/Trúc Mộng, mở hộp quà sẽ ưu tiên trừ Mật Ngữ Tinh Huy/Trúc Mộng trước. *n7. Mật Ngữ Trúc Mộng có thể thông qua việc tiêu 20 xu Mini để nhận được, cũng có thể trực tiếp dùng xu Mini để mở hộp quà, mở liên tiếp 5 lần sẽ được giảm giá, chỉ cần tiêu 88 xu Mini; @cfa7a0fMỗi ngày lần đầu mở gói quà Trúc Mộng sẽ được miễn phí, lần thứ 2 sẽ giảm 50%@n, lần thứ 3 trở đi sẽ khôi phục về giá gốc. *n8. Mật Ngữ Tinh Huy có thể thông qua việc tiêu 68 xu Mini để nhận được, cũng có thể trực tiếp dùng xu Mini để mở hộp quà, mở liên tiếp 5 lần sẽ được giảm giá, chỉ cần tiêu 318 xu Mini. *n9. Danh sách và xác suất thưởng của hộp quà Tinh Huy *nSkin/DIY (Vĩnh Viễn) 4.799% *nSkin/DIY (có thời hạn) 51.2% *nMảnh Skin 15% *nXu Mini 6% *nĐậu Mini 10% *nĐạo cụ 8% *nVé đổi skin Tinh Huy Xác suất ban đầu 0.001%, giá trị may mắn càng cao, xác suất nhận càng lớn, giá trị may mắn đầy chắc chắn sẽ nhận *n10. Danh sách và xác suất thưởng của hộp quà Trúc Mộng *nSkin/DIY (Vĩnh Viễn) 5.102% *nSkin/DIY (có thời hạn) 58.297% *nMảnh Skin 13% *nXu Mini 2.6% *nĐậu Mini 10% *nĐạo cụ 11% *nVé đổi skin Trúc Mộng Xác suất ban đầu 0.001%, giá trị may mắn càng cao, xác suất nhận càng lớn, giá trị may mắn đầy chắc chắn sẽ nhận.*n Đây là sản phẩm có cơ hội nhận được, người tiêu dùng mua hoặc tham gia sự kiện không có nghĩa là có thể nhận được sản phẩm đặc biệt này]],
            rule14 = [[1. Confezione regalo Starlight: un Codice stellare può essere utilizzato, e può essere aperto una volta, e c'è la possibilità di ottenere @cfa7a0fVoucher di scambio Starlight Skin@n.*n2. Confezione regalo Dream Building: utilizzare un Gashapon biglietteria, che può essere aperto una volta sola, e avere la possibilità di ottenere @cfa7a0fDream Building Skin Coupon@n.*n3. Voucher di scambio Starlight Skin e Dream Building Skin Coupon possono scambiare la loro pelle esclusiva presso il negozio di scambio. Il negozio di scambio lo aggiornerà di volta in volta e il numero di coupon di scambio non sarà cancellato.*n4. Quando il numero cumulativo di confezioni regalo aperte raggiunge il numero specificato, è possibile ricevere premi aggiuntivi. @cfa7a0f il numero cumulativo e i premi saranno ripristinati alle 0:00 (GMT + 8) ogni lunedì @n. Si prega di ricevere i premi in tempo.*n5. Ogni volta che la scatola regalo viene aperta, un certo numero di valori fortunati saranno aggiunti. Più alto è il valore fortunato, maggiore è la possibilità di ottenere il coupon di scambio. Quando il valore fortunato è pieno, si sarà in grado di ottenere un coupon di scambio la prossima volta che si apre la scatola regalo. Dopo aver ottenuto il coupon di scambio, il valore fortunato sarà ripristinato a 0 e accumulato di nuovo.*n6. Se c'è Codice stellare/Gashapon biglietteria nel conto, Codice stellare/Gashapon biglietteria verrà detratto preferenzialmente all'apertura della confezione regalo.*n7. Gashapon biglietteria può essere ottenuto spendendo 20Mini moneta; È inoltre possibile utilizzare Mini moneta per aprire direttamente la confezione regalo. C'è uno sconto per 5 volte consecutive, e solo 88Mini moneta è necessario @cfa7a0f È libero di aprire la scatola regalo di costruzione da sogno con mini moneta per la prima volta ogni giorno, metà prezzo @n per la seconda volta, e il prezzo originale sarà ripristinato dalla terza volta.*n8. Codice stellare può essere ottenuto spendendo 68Mini moneta, oppure è possibile utilizzare Mini moneta per aprire direttamente la confezione regalo. C'è uno sconto per cinque volte consecutive, solo 318Mini moneta.*n9.Confezione regalo Starlight Belohnungsliste und Wahrscheinlichkeit*n dress up nach Maß (permanent) 4.799%*n kleiden sich hoch und Anpassung (begrenzte Zeit) 51.2%*n dress up fragments 15%*n Mini moneta 6%*n Mini Bohnen 10%*n Requisiten 8%*n Die Anfangswahrscheinlichkeit von Voucher di scambio Starlight Skin beträgt 0.001%. Je höher der Glückswert, desto höher die Wahrscheinlichkeit. Der Glückswert muss ermittelt werden*n10.Confezione regalo Dream Building Belohnungsliste und Wahrscheinlichkeit*n dress up nach Maß (permanent) 5.102%*n dress up und Anpassung (begrenzte Zeit) 58.297%*n Anziehfragmente 13%*n Mini moneta 2.6%*n Mini Bohnen 10%*n Requisiten 11%*n Dream Building Skin Coupon Anfangswahrscheinlichkeit ist 0.001%, je höher der Glückswert, desto höher die Wahrscheinlichkeit, und der Glückswert muss erhalten werden *n Si tratta di un prodotto vincente e l'acquisto o la partecipazione dei consumatori all'attività non significa che possano ottenere un prodotto specifico]],
            rule16 = [[1. Kotak Bintang: Guna 1 Kod Bintang untuk membuka 1 kali, dapatkan @cfa7a0fkupon pertukaran Kulit Bintang@n. *n2、Kotak Impian: Guna 1 Kod Impian untuk membuka 1 kali, dapatkan @cfa7a0fkupon pertukaran Kulit Impian@n. *n3、Kupon pertukaran Kulit Bintang dan Kulit Impian boleh menukar kulit khas di kedai pertukaran. Kedai pertukaran akan dikemas kini dari semasa ke semasa, jumlah kupon pertukaran tidak akan dikosongkan. *n4、 Jumlah keseluruhan membuka kotak mencapai jumlah yang ditentukan, akan menerima ganjaran tambahan. @cfa7a0fJumlah keseluruhan dan ganjaran akan ditetapkan semula pada 0:00 （GMT+8) setiap Isnin@n, sila terima ganjaran tepat masanya. *n5、 Setiap kali membuka kotak, akan menambah Nilai Bertuah. Lebih tinggi Nilai Bertuah, lebih besar peluang untuk mendapat kupon pertukaran. Apabila Nilai Bertuah penuh, kali seterusnya anda membuka kotak, anda akan mendapat kupon pertukaran. Selepas itu, Nilai Bertuah akan ditetapkan semula sebagai kosong dan berkumpul semula. *n6、 Apabila mempunyai kod Bintang/ Impian dalam akaun, membuka kotak akan menolak kod Bintang/ Impian. *n7、 Kod Impian boleh didapati dengan membelanjakan 20 Koin Mini; anda juga boleh terus menggunakan Koin Mini untuk membuka kotak, terdapat diskaun jika pembukaan 5 kali berturut-turut bernilai 88 Koin Mini sahaja; @cfa7a0fKali pertama membuka Kotak Impian adalah percuma setiap hari, harga separuh untuk kali kedua@n, kali ketiga adalah harga asal. *n8、Kod Bintang boleh didapati dengan membelanjakan 68 Koin Mini, anda juga boleh terus menggunakan Koin Mini untuk membuka kotak, terdapat diskaun jika pembukaan 5 kali berturut-turut bernilai 318 Koin Mini sahaja. *n9、 Senarai ganjaran dan kebarangkalian Kotak Bintang *nKulit / Kustom (Kekal) 4.799% *nKulit / Kustom (Masa Terhad) 63.8% *nFragmen Kulit 7.4% *nKoin Mini 6% *nKacang Mini 10% Alat peraga 8% *nKupon pertukaran Kulit Bintang Kebarangkalian awal 0.001%, semakin tinggi Nilai Bertuah, semakin tinggi kebarangkalian, Ni