            rule12 = [[1. Подарочная коробка Starlight: использовать один Звездный код, который может быть открыт один раз и иметь доступ к @cfa7a0fОбменный ваучер Starlight Skin@n. *n2. Подарочная коробка: использовать одну Гасяпон, которая может быть открыта 1 раз, и иметь доступ к @cfa7a0fКупить Dream Building Skin Coupon@n. *n3. Обменный ваучер Starlight Skin и Купить Dream Building Skin Coupon могут обменивать исключительную кожу в обменных магазинах, меняя магазины на нерегулярной основе, Количество купонов колеблется от нуля. *n4. если количество открываемых коробок достигает установленного количества, то можно также получить дополнительные бонусы @cfa7a0f, которые будут заменены в 0: 00 в неделю (GMT + 8)@n, и своевременно получать премию. *n5. каждый раз, когда открываются коробки, прибавляется определенное количество удачи, чем выше значение удачи, тем больше возможностей для получения ваучеров, когда удача полна, в следующий раз, когда откроются коробки, чтобы получить талон, после того, как он будет получен, счастливая стоимость будет заменена на 0 и вновь накапливается. *n6.при открытии учётной записи Звездный код / Гасяпон предпочтение будет отдаваться чтению Звездный код / Гасяпон.*n7. Гасяпон можно получить через расходы 20Мини монеты; можно также использовать прямой запуск коробки @cfa7a0fОбменный ваучер Starlight Skin@n с скидкой 5 раз, только за 88Мини монеты;@cfa7a0f каждый день мини - банкноты запускаются бесплатно, вторые половинки @n, третьи возобновляются в цене. *n8. Звездный код можно получить за счет расходов 68Мини монеты, также можно использовать Мини монеты непосредственно открыть коробку с скидкой 5 раз, только 318Мини монеты. *n9. список премий и вероятность *n орнамент / заказ (постоянный) 4.799% *n украшение / заказ (ограничение времени) 51.2% *n изображать осколки 15% *n Мини монеты 6% *n мини - фасоль 10% *n реквизит 8% *n первоначальная вероятность Обменный ваучер Starlight Skin 0.001, чем выше вероятность удачи, тем выше вероятность того, что удача закончится *n10. Подарочная коробка бонус список и вероятность *n наряд / заказ (постоянный) 5.102% *n украшение / заказ (ограничение времени) 58.297% *n изображать осколки 13% *n Мини монеты 2.6% *n мини - фасоль 10% *n реквизит 11% *n первоначальная вероятность 0.001% Купить Dream Building Skin Coupon, чем выше вероятность удачи, тем выше вероятность того, что удача закончится *n Это дает возможность выигрывать товары, которые могут приобрести потребители, не представляющие их интересы при покупке или участии в деятельности]],
            rule11 = [[1. Starlight Hediye Kutusu: Bir Yıldız kodu kullan, bir kez a çabilirsin ve @cfa7a0fStarlight Cilt Değişim Kuponu@n'yi almak için bir şansın var.*n2. Rüya Bina Hediye Kutusu: Eğer bir Oyuncak otomatı bileti kullanılırsa, bir kez a çılır ve @cfa7a0fRüya Bina Cilt Kupon@n elde etme şansı var.*n3. Starlight Cilt Değişim Kuponu ve Rüya Bina Cilt Kupon değiştirme dükkanında özel derilerini değiştirebilir. Alışma dükkanında onları zamanla güncelleştirir ve değiştirme kuponunun sayısı temizlenmeyecek.*n4. Açıklama hediye kutularının toplamlı sayısı belirtilen sayıya ulaştığında, ayrıca fazla ödüller alabilirsiniz, @cfa7a0f toplamlı zamanlar ve ödüller her pazartesi 0:00 (GMT + 8) @n. Lütfen ödülleri zamanında alın.*n5. Every time the gift box is opened, a certain number of lucky values will be added. The higher the lucky value, the greater the chance of obtaining a coupon. When the lucky value is full, you will be able to obtain a coupon next time you open the gift box. After obtaining the coupon, the lucky value will be reset to 0 and accumulated again.*n6. Hesapta Yıldız kodu / Oyuncak otomatı bileti varken hediye kutusu açmak Yıldız kodu / Oyuncak otomatı bileti değerlendirmesi için öncelik verir.*n7. Oyuncak otomatı bileti 20 Minik altın harcılığıyla alınabilir; Ayrıca hediye kutusu doğrudan a çılmak için Minik altın kullanabilirsiniz. 5 defa ayrılır ve sadece 88Minik altın ihtiyacı var@cfa7a0f Hayal binası hediye kutusunu her gün ilk defa mini para ile açmak özgür, ikinci defa yarım fiyat @n ve orijinal fiyat üçüncü defa geri alınacak.*n8. Yıldız kodu 68Minik altın harcılığıyla alınabilir, ya da hediye kutusunu doğrudan a çmak için Ss kullanabilirsiniz. Beş seferinde ayrılış kez alır ve sadece 318Minik altın ihtiyacı var.*n9. Starlight Hediye Kutusu ödül listesi ve muhtemelen*n giyinme / custom (permanent) 4.799%*n giyinme / Customization (sınırlı zamanı) 51.2%*n dress up fragments 15%*n Minik altın 6%*n Mini beans 10%*n props 8%*n Starlight Cilt Değişim Kuponu'nin başlangıç muhtemelesi 0.001%. Şanslı değeri daha yüksek, muhtemelen daha yüksek. Şanslı değer alınmalıdır.*n10. Rüya Bina Hediye Kutusu ödül listesi ve muhtemelen*n giyinme / custom (permanent) 5.102%*n giyinme / Customization (sınırlı zamanı) 58.297%*n parçalarını 13%giyin*n Minik altın 2.6%*n Mini beans 10%*n props 11%*n Rüya Bina Cilt Kupon ilk muhtemelen 0.001%, şanslı değeri daha yüksek, muhtemelen daha yüksek ve şanslı değeri elde etmelidir. *n Bu, ürün kazanma fırsatı, ve tüketicilerin alınması ya da etkinliğe katılması, özel bir ürün alabileceğini anlamına gelmez.]],
            rule4 = [[1. Gashapon de estrella: use 1 código estrella para abrirlo una vez y tenga la oportunidad de obtener @cfa7a0f cupón de canje de piel estrella@n.*n2. Gashapon de sueño: use 1 código de sueño para abrirlo una vez y tenga la oportunidad de obtener @cfa7a0f cupón de canje de aspectos de sueño@n.*n3, Los cupones de canje de avatar de sueño y de estrella se pueden canjear por avatares exclusivas en la tienda de canje, la tienda de canje se actualizará de vez en cuando y la cantidad de cupones de canje no está clara.*n4. Cuando el número acumulativo de abrir cajas de regalo alcance el número especificado, también puede recibir recompensas adicionales. @cfa7a0f El número acumulativo de veces y las recompensas se restablecerán @n todos los lunes a las 0:00(GMT+8), reclame las recompensas a tiempo .*n5. Cada vez que se abre la gashapon, se agregará una cierta cantidad de valor de la suerte. Cuanto mayor sea el valor de la suerte, mayor será la posibilidad de obtener un cupón de canje. Cuando el valor de la suerte esté lleno, la próxima vez que se abra la gashapon se abre, se obtendrá un cupón de canje.Después de recibir el cupón, el valor de la suerte se restablecerá a 0 y se acumulará nuevamente.*n6. Cuando haya código de sueños o de estrellas en la cuenta, abrir la gashapon dará prioridad a la deducción.*n7. El código de sueños se puede obtener gastando 20 mini monedas; también puede usar las mini monedas para abrir la gashapon directamente, habrá un descuento por abrir 5 veces seguidas y solo gaste 88 mini -monedas; @cfa7a0f gasta las primeras minimonedas todos los días para abrir la gashapon de sueños gratis, la segunda mitad de precio @n, la tercera vez para restaurar el precio original.*n8. El código de estrella se puede obtener gastando 68 mini monedas, o puede usar las mini monedas para abrir la gashapon directamente. Hay un descuento por abrir 5 veces seguidas, y solo cuesta 318 mini monedas.*n9. Lista de recompensas y probabilidad de la gashapon de estrella*nAvatar (permanente) 4.799%*nAvatar (tiempo limitado) 51.2%*nFragmentos de avatar 15%*nMini monedas 6%*nMini frijoles 10%*nHerramienta 8%*nLa probabilidad inicial del cupón de canje de piel estrella es 0.001%, cuanto mayor sea el valor de la suerte, mayor será la probabilidad y se obtendrá el valor de la suerte*n10. Lista y probabilidad de recompensas de cajas de regalo de sueños*nAvatar (permanente) 5.102%*nAvatar (tiempo limitado) 58.297%*nFragmentos de avatar 13%*nMini monedas 2.6%*nMini frijoles 10%*nHerramienta 11%*nLa probabilidad inicial del cupón de canje de piel de sueño es 0.001%, cuanto mayor sea el valor de la suerte, mayor será la probabilidad y se obtendrá el valor de la suerte *n Este es un producto ganador probabilístico. La compra o participación de los consumidores en el evento no significa que puedan obtener productos específicos]],
            rule15 = [[1. Kotak Hadiah Bintang: Gunakan 1 Kupon Bintang untuk membukanya sekali, dan dapatkan kesempatan untuk dapatkan @cfa7a0f Kupon Skin Bintang@n.*n2.Kotak Hadiah Mimpian：Gunakan 1 Kupon Mimpian untuk membukanya sekali, dan dapatkan kesempatan untuk dapatkan@cfa7a0fKupon Skin Bintang@n。*n3, Kupon Skin Bintang, Kupon Skin mimpian dapat ditukar dengan skin eksklusif di toko pertukaran. Toko pertukaran akan diperbarui dari waktu ke waktu, tapi jumlah kupon skin tersebutnya tidak akan dikosongkan.*n4. Ketika jumlah total pembukaan kotak hadiah mencapai jumlah tertentu, dapat menerima hadiah tambahan @cfa7a0f Jumlah total kali dan hadiah akan direset @n setiap hari Minggu pukul 23:00, mohon klaim hadiah tepat waktu .*n5. Setiap kali kotak hadiah dibuka, sejumlah nilai keberuntungan akan ditambahkan. Semakin tinggi nilai keberuntungan, semakin besar peluang untuk mendapatkan kupon skin. Jika nilai keberuntungan penuh, saat berikutnya kotak hadiah dibuka, dengan kesempatan 100% dapatkan kupon skin. Setelah menerima kupon skin, nilai keberuntungan akan direset menjadi 0 dan diakumulasikan ulang.*n6. Ketika ada Kupon Mimpi/Bintang di akun, Kupon Mimpian/Bintang dikurangi dengan prioritas saat kotak hadiah dibuka.*n7. Kupon Mimpian dapat dibeli dengan habiskan 20 mini coin; dan juga bisa menggunakan mini coin untuk buka kotak hadiah secara langsung, akan ada diskon untuk pembukaan 5 kali berturut-turut, dan hanya menghabiskan 88 mini coin; @cfa7a0f menghabiskan koin mini pertama setiap hari untuk buka kotak hadiah Mimpian secara gratis, harga paruh saat kedua kali@n, dan mengembalikan harga aslinya saat ketiga kalinya. *n8. Kupon Bintang Kupon Mimpian dapat dibeli dengan habiskan 68 koin mini, dan juga bisa menggunakan mini coin untuk buka kotak hadiah secara langsung, akan ada diskon untuk pembukaan 5 kali berturut-turut, dan hanya menghabiskan 318 mini coin*n9. Daftar hadiah dan peluang Kotak Hadiah Bintang*nCustom (permanen) 4.799%*nCustom (terbatas) 51.2%*nShard Custom 15%*nMini Coin 6%*nMini Bean 10%*nItem 8%*nKupon Skin Bintang, peluang awal adalah 0,001%, semakin tinggi nilai keberuntungan, semakin besar peluangnya, dan saat nilai keberuntungan penuh, peluang 100%.*n10. Daftar hadiah dan peluang Kotak Hadiah Mimpian*nCustom (permanen) 5.102%*nCustom (terbatas) 58.297%*nShard Custom 13%*nMini Coin 2.6%*nMini Bean 10%*nItem 11%*nKupon Skin Mimpian, peluang awal adalah 0,001%, semakin tinggi nilai keberuntungan, semakin besar peluangnya, dan saat nilai keberuntungan penuh, peluangnya menjadi 100%. *n Ini adalah produk peluang, pembelian atau partisipasi konsumen dalam event tidak memberikan hak kepada konsumen untuk mendapat produk tertentu.]],
            rule1 = [[1、Star Pack: Use 1 Star Code to open it, and have a chance to get @cfa7a0fStar skin exchange coupon@n.*n2、Dreamer Pack: Use 1 Dreamer Code to open it, and have a chance to get @cfa7a0fDreamer skin exchange coupon@n.*n3、Star skin exchange coupon and dreamer skin exchange coupon can be exchanged for exclusive skins in the exchange shop. The exchange store will be updated from time to time, and the number of exchange coupons will not be cleared.*n4、When opened packs reach a specified number, you can receive additional rewards. @cfa7a0fThe cumulative number of times and rewards will be reset at 0:00(UTC+8) every Monday@n. Please claim your rewards in time.*n5、Every time you open a pack will add some lucky points for you. The more lucky points you have, the better your chance of getting the exchange coupon. When the lucky points are full, the next time you open a pack, you will get an exchange coupon. After you get an exchange coupon, the lucky points will be reset to 0 and then re-accumulated.*n6、If you have Star / Dreamer Code in your account, the Star / Dreamer Code will be deducted first when you open packs.*n7、You can spend 20 Mini Coins to get the Dreamer Code and also can use Mini Coins to open packs directly. There will be a discount if you open 5 times in a row. It only spends 88 Mini Coins. @cfa7a0fThe first time you spend Mini coins every day to open the Dreamer Pack is free, the second time it is half price @n, and the third time it will be restored to the original price.*n8、You can spend 68 Mini Coins to get the Star Code and also can use Mini Coins to open packs directly. There will be a discount if you open 5 times in a row. It only spends 318 Mini Coins. *n9、Star Pack Reward List and Probability*n Skin/Custom (Permanent) 4.799%*n Skin/Custom(Limited Time) 51.2%*n Skin Shards 15%*n Mini Coin 6%*n Mini Bean 10%*n Props 8%*n Star skin coupon The Initial probability is 0.001%. The initial probability is 0.001%. The higher the luck, the higher the probability. When the luck reaches the peak, you will get the skin coupon.*n10、Dreamer Pack Reward List and Probability*n Skin/Custom (permanent) 5.102%*n Skin/Custom (Limited Time) 58.297%*n Skin shards 13%*n Mini Coin 2.6%*n Mini Bean 10%*n Props 11%*n Dreamer skin coupon The higher the luck, the higher the probability. When the luck reaches the peak, you will get the skin coupon. *n This is a probabilistic item and the purchase or participation does not entitle the consumer to a specific prize.]],
            rule3 = [[1.แพ็คสตาร์ไลท์: ใช้1โค้ดสตาร์ไลท์เพื่อเปิด 1 ครั้ง จะมีโอกาสได้รับ @cfa7a0f คูปองสกินสตาร์ไลท์@n *n2、แพ็คสร้างฝัน: ใช้ 1 โค้ดสร้างฝันเพื่อเปิด 1 ครั้ง จะมีโอกาสได้รับ@cfa7a0fคูปองสกินสร้างฝัน@n *n3、คูปองสกินสตาร์ไลท์ และคูปองสกินสร้างฝัน สามารถแลกสกินจำกัดได้ที่ร้านแลกเปลี่ยน ร้านแลกเปลี่ยนจะอัปเดตเป็นครั้งคราว และจำนวนคูปองจะไม่ถูกรีเฟรช *n4、เมื่อจำนวนการเปิดครบที่กำหนด จะสามารถรับรางวัลพิเศษได้ @cfa7a0fจำนวนการเปิด และรางวัลจะถูกรีเฟรช ณ 23:00 ทุกวันอาทิตย์@n โปรดรับรางวัลก่อนหมดเวลา *n5、ทุกครั้งที่เปิดแพ็ค จะเพิ่มค่าโชคดีจำนวนหนึ่ง ค่าโชคดียิ่งสูง จะเพิ่มโอกาสได้รับคูปองสูงขึ้น เมื่อค่าโชคดีเต็มแล้ว ในครั้งต่อไปที่เปิดแพ็ค จะได้รับคูปองแน่นอน หลังจากได้รับคูปองนี้แล้ว ค่าโชคดีจะถูกรีเฟรชเป็น 0 และเริ่มสะสมใหม่ *n6、ถ้าในบัญชีมีโค้ดสตาร์ไลท์/ สร้างฝัน เมื่อเปิดแพ็ค ระบบจะเลือกหักโค้ดสตาร์ไลท์/ สร้างฝันก่อนโดยอัตโนมัติ *n7、โค้ดสร้างฝันสามารถรับได้โดยใช้ 20 Mcoin และสามารถใช้ Mcoin เพื่อเปิดแพ็คได้โดยตรงอีกด้วย การเลือกเปิด 5 ครั้งราคาเพียง 88 Mcoin เท่านั้น @cfa7a0fทุกวันการเปิดแพ็คสร้างฝันครั้งแรกจะฟรีด้วยคูปอง การเปิดครั้งที่ 2 ลดราคา 50%@n การเปิดครั้งที่ 3 จะกลับเป็นราคาเดิม *n8、สามารถใช้ 68 Mcoin เพื่อรับโค้ดสตาร์ไลท์ได้ หรือใช้ Mcoin เพื่อเปิดแพ็ค การเลือกเปิด 5 ครั้งจะได้รับส่วนลด ราคาเพียง 318 Mcoin เท่านั้น *n9、รายการและโอกาสได้รับรางวัลแพ็คสตาร์ไลท์*nสกิน/อวาตาร์ (ถาวร) 4.799% *nสกิน/อวาตาร์ (ทดลอง) 51.2% *nชิ้นส่วนสกิน 15% *nMcoin 6% *nถั่วมินิ 10% *nไอเทม 8% *nโอกาสได้รับคูปองสกินสตาร์ไลท์เริ่มต้นที่ 0.001% ค่าโชคดียิ่งสูง จะเพิ่มโอกาสได้รับคูปองสูงขึ้น เมื่อค่าโชคดีเต็มแล้ว ในครั้งต่อไปที่เปิดแพ็ค จะได้รับคูปองแน่นอน *n10、รายการและโอกาสได้รับรางวัลแพ็คสร้างฝัน*nสกิน/อวาตาร์ (ถาวร) 5.102% *nสกิน/อวาตาร์ (ทดลอง) 58.297% *nชิ้นส่วนสกิน 13% *nMcoin 2.6% *nถั่วมินิ 10% *nไอเทม 11% *nโอกาสได้รับคูปองสกินสร้างฝัน เริ่มต้นที่ 0.001% ค่าโชคดียิ่งสูง จะเพิ่มโอกาสได้รับคูปองสูงขึ้น เมื่อค่าโชคดีเต็มแล้ว ในครั้งต่อไปที่เปิดแพ็ค จะได้รับคูปองแน่นอน *n นี่คือไอเทมที่มีโอกาสได้รับ การซื้อหรือการเข้าร่วมกิจกรรมไม่ได้หมายความว่าจะได้รับไอเทมที่ระบ