        [2] = {
            rule0 = [[1、星辉礼盒：使用1个星辉暗语，可开启1次，有机会获得@cfa7a0f星辉皮肤兑换券@n。*n2、筑梦礼盒：使用1个筑梦暗语，可开启1次，有机会获得@cfa7a0f筑梦皮肤兑换券@n。*n3、星辉皮肤兑换、筑梦皮肤兑换券可在兑换商店兑换专属皮肤，兑换商店会不定期更新，兑换券数量不清零。*n4、累计开启礼盒次数达到指定数量时，还可领取额外奖励，@cfa7a0f累计次数和奖励均会在每周一0点（GMT+8）重置@n，请及时领取奖励。*n5、每开启礼盒一次，均会增加一定数量的幸运值，幸运值越高，获得兑换券的机会就越大，当幸运值满时，下次开启礼盒必能获得一个兑换券，获得兑换券后，幸运值会重置为0后重新累计。*n6、账户中有星辉/筑梦暗语时，开启礼盒将会优先扣除星辉/筑梦暗语。*n7、筑梦暗语可通过花费20迷你币获得；也可以使用迷你币直接开启礼盒，连开5次有折扣，仅需花费88迷你币；@cfa7a0f每日首次花费迷你币开启筑梦礼盒免费，第二次半价@n，第三次起恢复原价。*n8、星辉暗语可通过花费68迷你币获得，也可以使用迷你币直接开启礼盒，连开5次有折扣，仅需花费318迷你币。*n9、星辉礼盒奖励列表和概率*n装扮/定制（永久） 4.799%*n装扮/定制（限时） 51.2%*n装扮碎片15%*n迷你币 6%*n迷你豆 10%*n道具 8%*n星辉皮肤兑换券 初始概率0.001%，幸运值越高概率越高，幸运值满必得*n10、筑梦礼盒奖励列表和概率*n装扮/定制（永久） 5.102%*n装扮/定制（限时） 58.297%*n装扮碎片 13%*n迷你币 2.6%*n迷你豆 10%*n道具 11%*n筑梦皮肤兑换券 初始概率0.001%，幸运值越高概率越高，幸运值满必得。*n 此为机会中奖商品，消费者购买或参与活动不代表即可获得特定商品]],
            rule13 = [[1. Starlight Geschenkbox: ein Stern-Code kann verwendet werden, und es kann einmal geöffnet werden, und es gibt eine Chance, @cfa7a0fStarlight Skin Umtauschgutschein@n zu erhalten.*n2. Traumbau-Geschenkbox: Verwenden Sie einen Gashapon Ticket, der einmal geöffnet werden kann, und haben Sie die Möglichkeit, @cfa7a0fTraumgebäude-Skin-Coupon@n zu erhalten.*n3. Starlight Skin Umtauschgutschein und Traumgebäude-Skin-Coupon können ihren exklusiven Skin im Tauschshop umtauschen. Der Tauschshop aktualisiert ihn von Zeit zu Zeit, und die Anzahl der Tauschcoupons wird nicht gelöscht.*n4. Wenn die kumulative Anzahl der sich öffnenden Geschenkboxen die angegebene Anzahl erreicht, können Sie auch zusätzliche Prämien erhalten.@cfa7a0f Die kumulative Anzahl und Prämien werden jeden Montag auf 0:00 (GMT-8) zurückgesetzt@n. Bitte erhalten Sie die Prämien rechtzeitig.*n5.Jedes Mal, wenn die Geschenkbox geöffnet wird, wird eine bestimmte Anzahl von Glückswerten hinzugefügt. Je höher der Glückswert, desto größer die Chance, den Tauschcoupon zu erhalten. Wenn der Glückswert voll ist, können Sie einen Tauschcoupon beim nächsten Öffnen der Geschenkbox erhalten. Nach Erhalt des Tauschcoupons wird der Glückswert auf 0 zurückgesetzt und wieder angesammelt.*n6. Wenn Stern-Code/Gashapon Ticket auf dem Konto ist, wird Stern-Code/Gashapon Ticket bevorzugt beim Öffnen der Geschenkbox abgezogen.*n7. Gashapon Ticket kann durch Ausgaben von 20s erhalten werden; Sie können die Geschenkbox auch direkt mit Minimünze öffnen. Es gibt einen Rabatt für fünf aufeinanderfolgende Male, und es werden nur 88Minimünze benötigt@cfa7a0f Es ist kostenlos, die Traumbau Geschenkbox mit Mini-Münze jeden Tag zum ersten Mal zu öffnen, zum zweiten Mal zum halben Preis @n, und der ursprüngliche Preis wird vom dritten Mal wiederhergestellt.*n8.Stern-Code erhalten Sie, indem Sie 68Minimünze ausgeben, oder Sie können Minimünze verwenden, um die Geschenkbox direkt zu öffnen. Es gibt einen Rabatt für fünf aufeinanderfolgende Male, nur 318Minimünze.*n9.Starlight Geschenkbox Belohnungsliste und Wahrscheinlichkeit*n dress up nach Maß (permanent) 4.799%*n kleiden sich hoch und Anpassung (begrenzte Zeit) 51.2%*n dress up fragments 15%*n Minimünze 6%*n Mini Bohnen 10%*n Requisiten 8%*n Die Anfangswahrscheinlichkeit von Starlight Skin Umtauschgutschein beträgt 0.001%. Je höher der Glückswert, desto höher die Wahrscheinlichkeit. Der Glückswert muss ermittelt werden*n10.Traumbau-Geschenkbox Belohnungsliste und Wahrscheinlichkeit*n dress up nach Maß (permanent) 5.102%*n dress up und Anpassung (begrenzte Zeit) 58.297%*n Anziehfragmente 13%*n Minimünze 2.6%*n Mini Bohnen 10%*n Requisiten 11%*n Traumgebäude-Skin-Coupon Anfangswahrscheinlichkeit ist 0.001%, je höher der Glückswert, desto höher die Wahrscheinlichkeit, und der Glückswert muss erhalten werden *n Dies ist ein Produkt, das Chancen gewinnt, und der Kauf oder die Teilnahme der Verbraucher an der Aktivität bedeutet nicht, dass sie ein bestimmtes Produkt erhalten können]],
