            rule8 = [[1 ، ستاربكس هدية مربع : استخدام ستاربكس كلمة السر ، يمكن أن تفتح مرة واحدة ، لديك الفرصة للحصول على @ cfa7aaf ستاربكس الجلد قسيمة الصرف .n*2 ، حلم بناء هدية مربع : استخدام حلم بناء كلمة السر ، يمكنك فتح مرة واحدة ، لديك الفرصة للحصول على @cfa7a0f حلم بناء الجلد تبادل القسيمة @n ن . 3*n ، ستار تبادل الجلد ، حلم بناء الجلد تبادل القسائم يمكن تبادلها في متجر تبادل الجلد الحصري ، تبادل المتجر سوف يتم تحديثها بشكل غير منتظم ، عدد من تبادل القسائم ليست واضحة . 4*n التراكمي فتح عدد من الهدايا إلى عدد معين ، يمكنك أيضا الحصول على مكافآت إضافية ، @ cfa7aaf التراكمي مرات والمكافآت في الأسبوع 10 نقطة ( بتوقيت جرينتش + 8 ) إعادة تعيين @n ، يرجى الحصول على مكافآت في الوقت المناسب .5*n ، في كل مرة فتح هدية مربع ، وسوف تزيد من عدد معين من قيمة الحظ ، وارتفاع قيمة الحظ ، فرصة أكبر للحصول على قسيمة الصرف ، عندما تكون قيمة الحظ الكامل ، في المرة القادمة فتح هدية مربع سوف تكون قادرة على الحصول على قسيمة الصرف ، بعد الحصول على قسيمة الصرف ، قيمة الحظ سيتم إعادة تعيين إلى 0 بعد تراكم . رقم 6*n ، عندما يكون هناك ستاربكس / حلم بناء كلمة السر في الحساب ، سيتم خصم ستاربكس / حلم بناء كلمة السر قبل فتح هدية مربع . 7*n ، حلم كلمة السر يمكن الحصول عليها عن طريق انفاق 20 عملة صغيرة . يمكنك أيضا فتح هدية مربع مع ميني المال مباشرة ، خصم 5 مرات على التوالي ، فقط 88 ميني المال ؛ @cfa7a0f تنفق كل يوم أول عملة صغيرة لفتح الحلم هدية مربع مجانا ، للمرة الثانية نصف السعر @n للمرة الثالثة منذ استعادة السعر الأصلي . 8*n ، ستار فاي كلمة السر يمكن الحصول عليها من خلال إنفاق 68 عملة صغيرة ، ويمكن أيضا استخدام عملة صغيرة لفتح هدية مربع مباشرة ، حتى فتح 5 مرات الخصم ، تحتاج فقط إلى إنفاق 318 عملة صغيرة . 9*n ، ستار فاي هدية مربع مكافأة قائمة واحتمال * ن اللباس / العرف ( دائم ) 4.799 ٪ * ن اللباس / العرف ( الوقت المحدد ) 51.2 في المائة * ن اللباس قطعة 15 في المائة * ن ميني عملة 6 ٪ * ن ميني الفول 10 ٪ * ن الدعائم 8 ٪ * ن ستار فاي الجلد تبادل قسيمة الاحتمال الأولي 0.001 في المائة ، وارتفاع احتمال قيمة الحظ ، يجب أن تكون القيمة الكاملة 10*n بناء حلم هدية مربع مكافأة قائمة واحتمال * ن اللباس / العرف ( دائم ) 5.102 ٪ * ن اللباس / العرف ( الوقت المحدد ) 58.297 ٪ * ن اللباس قطعة 13 ٪ * ن ميني عملة 2.6 في المائة * ن ميني الفول 10 ٪ * ن الدعائم 11 ٪ * ن بناء حلم الجلد تبادل قسيمة الاحتمال الأولي 0.001 في المائة ، وارتفاع احتمال قيمة الحظ ، يجب أن يكون كامل قيمة الحظ*n هذا هو فرصة للفوز بجائزة السلع ، والمستهلكين شراء أو المشاركة في أنشطة لا تمثل إمكانية الحصول على سلعة معينة]],
            rule6 = [[1. Coffret cadeau Starlight: un Code étoile peut être utilisé une fois pour obtenir @cfa7a0f Bon d'échange Starlight Skin@n.*n2. Boîte-cadeau de construction de rêve : 1 Gashapon ticket peut être activé une fois pour obtenir @cfa7a0f Coupons de réduction@n.*n3. Gg et Coupons de réduction peuvent échanger leurs peaux exclusives dans les magasins de change. Les magasins de change les mettront à jour de temps à autre et le nombre de bons de change ne sera pas réglé à zéro.*n4. Lorsque le nombre cumulatif de boîtes - cadeaux ouvertes atteint la quantité spécifiée, vous pouvez également recevoir une récompense supplémentaire. @cfa7a0f le nombre cumulatif de fois et la récompense seront réinitialisés à 0: 00 (GMT + 8) Chaque semaine@n. Veuillez recevoir la récompense en temps opportun.*n5. Chaque fois que la boîte - cadeau est ouverte, un certain nombre de valeurs chanceuses seront ajoutées. Plus la valeur chanceuse est élevée, plus la chance d'obtenir un bon d'échange est grande. Lorsque la valeur chanceuse est pleine, un bon d'échange sera obtenu la prochaine fois que la boîte - cadeau est ouverte. Après avoir obtenu le bon d'échange, la valeur chanceuse sera réinitialisée à 0 et accumulée à nouveau.*n6. Lorsqu'il y a Code étoile / Gashapon ticket dans le compte, l'ouverture de la boîte - cadeau entraînera une déduction préférentielle de Code étoile / Gashapon ticket.*n7. L'Gashapon ticket peut être obtenue en dépensant 20 Mini-pièce; Vous pouvez également ouvrir la Boîte cadeau directement en utilisant Mini-pièce. Il y a une réduction pour ouvrir la boîte 5 fois. Il ne coûte que 88 Mini-pièce; @cfa7a0f pour la première fois chaque jour pour ouvrir la Boîte cadeau de rêve avec mini - pièce gratuite, deuxième demi - prix@n, troisième retour au prix original.*n8. Code étoile peut être obtenu en dépensant 68 Mini-pièce ou en utilisant Mini-pièce pour ouvrir directement la Boîte cadeau. Il y a une réduction pour ouvrir 5 fois, seulement 318 Mini-pièce 