            rule5 = [[1. Caixa de presente de estrela: Use 1 Sussurro da estrela para abri-lo uma vez e tenha a chance de obter @cfa7a0f cupom de resgate de skins de estrela@n. *n2. Caixa de presente de construção de sonhos: Use 1 Código de código de construção de sonhos para abri-lo uma vez e tenha a chance de obter @cfa7a0f cupom de resgate de skins de construção de sonhos@n. *n3. Cupom de resgate de skins de estrela e cupom de resgate de skins de construção de sonhos podem ser resgatados por skins exclusivas na loja de resgate, a loja de resgate será atualizada de tempos em tempos e o número de vales não será limpado . *n4. Quando o número cumulativo de caixas de presente abertas atingir o número especificado, você também poderá receber recompensas adicionais. @cfa7a0f O número cumulativo de vezes e recompensas será redefinido @n todas as segundas-feiras às 0:00 (GMT+8), por favor, reivindique as recompensas a tempo. *n5. Toda vez que a caixa de presente é aberta, uma certa quantia de valor da sorte será adicionada. Quanto maior o valor da sorte, maior a chance de obter um cupom de resgate. Quando o valor da sorte estiver cheio, da próxima vez a caixa de presente for aberto, será obtido um cupom de resgate. Após o recebimento do cupom, o valor da sorte será zerado e acumulado novamente. *n6. Quando houver Sussurro da estrela/Código de Construção dos Sonhos na conta, a abertura da caixa de presente dará prioridade à dedução de Sussurro da estrela/Código de Construção dos Sonhos. *n7. O Sussurro da estrela pode ser obtido gastando 20 Mini Moedas. Você também pode usar as Mini Moedas para abrir a caixa de presente diretamente, há um desconto para abrir 5 vezes seguidas e custa apenas 88 Mini Moedas. @ cfa7a0f 1ª vez dos todos os dias de abrir a caixa de presente da construção dos sonhos é grátis, a segunda metade do preço @n, a terceira vez para restaurar o preço original. *n8. Sussurro da estrela pode ser obtido gastando 68 Mini Moedas, ou você pode usar as Mini Mo