            rule7 = [[1、スターパック：1つのスターコードを使用して一度開くと、@cfa7a0fスタースキン交換券@nを取得するチャンスがあります。*n2、築夢パック：：1つの築夢コードを使用して一度開くと、@cfa7a0f築夢スキン交換券@nを取得するチャンスがあります。*n3、スタースキン交換券と築夢スキン交換券は、交換ストアで専用スキンと交換できます。交換ストアは随時更新され、交換券の数はクリアされません。*n4、パックを開く累積数が指定された数に達すると、追加の報酬を受け取ることもできます。@cfa7a0f累積回数と報酬は毎週月曜日の1:00にリセットされます@n、時間内に報酬を受け取ってください。*n5、パックを開けるたびに、一定の幸運値が加算されます。幸運値が高いほど、交換券を獲得できる可能性が高くなります。幸運値がいっぱいになると、次回にパックを開けたとき、必ず交換券を取得できます。その後、幸運値は0にリセットされ、再度累積されます。 *n6、アカウントにスター/築夢コードがある場合、パックを開くとスター/築夢コードが優先に使用されます。 *n7、築夢コードは、20枚のミニコインを使うことで取得できます。また、ミニコインを使用してパックを直接開くこともできます。5回連続で開くと割引があり、88枚のミニコインしかありません。@cfa7a0f毎日初回にミニコインを使用して築夢パックを開くのは無料、二回目は5割引@n、3回目は元の価格に戻します。*n8、スターコードは、68枚のミニコインを使用して取得するか、ミニコインを使用してパックを直接開くことができます。5回続けて開くと割引があり、318枚のミニコインしかかかりません。*n9、スターパックの報酬リストと確率*nスキン/アバター（永久） 4.799％*nスキン/アバター（期間限定） 51.2％*nスキンかけら 15％*nミニコイン 6％*nミニビーン 10％*nアイテム 8%*nスタースキン交換券 初期確率0.001％、幸運値が高いほど、確率は高くなります。幸運値は満タンになると必ずもらえます。*n10、築夢パックの報酬リストと確率*nスキン/アバター（永久） 5.102％*nスキン/アバター（期間限定）58.297％*nスキンかけら 13％*nミニコイン 2.6％*nミニビーン 10％*nアイテム 11%*n築夢スキン交換券 初期確率0.001％、幸運値が高いほど、確率は高くなります。幸運値は満タンになると必ずもらえます。*n この商品は当たるチャンスがある商品であり、消費者の購入またはイベントへの参加は、特定の商品を手に入れることを意味するものではありません]],
            rule9 = [[1.별빛 선물 상자: 스타 코드 1개를 사용하여 1회 오픈할 수 있으며 CC를 획득할 수 있는 기회가 있습니다.*n2.드림빌딩 선물상자: 꼬임 쿠폰 1개를 사용하여 1회 오픈 가능하며 @cfa7a0f드림빌딩 스킨쿠폰@n 를 획득할 수 있습니다.*n3. 별빛 피부 교환 바우처: 드림빌딩 스킨쿠폰 는 교환 상점에서 전속 피부를 교환할 수 있으며, 교환 상점은 비정기적으로 갱신되며, 교환권의 수량이 0이 되지 않습니다.*n4. 선물 상자 누적 오픈 횟수가 지정된 수량에 도달하면 추가 보상을 수령할 수 있습니다. @cfa7a0f 누적 횟수와 보상은 매주 월요일 0시(GMT+8)에 리셋됩니다@n, 적절한 시기에 보상을 수령하세요.*n5. 선물 상자를 열 때마다 일정 수량의 행운치가 증가합니다. 행운치가 높을수록 교환권을 획득할 기회가 커집니다. 행운치가 가득 차면 다음에 선물 상자를 열면 반드시 교환권을 획득할 수 있습니다. 교환권을 획득하면 행운치가 0으로 리셋되어 다시 누적됩니다.*n6. 계좌에 스타 코드/꼬임 쿠폰 가 있으면 선물 상자를 열면 스타 코드/꼬임 쿠폰 를 우선 공제합니다.*n7.꼬임 쿠폰 는 20미니코인 를 소비하여 획득할 수 있다.미니코인 를 사용하여 선물 상자를 직접 오픈할 수도 있고, 5회 연속 오픈 시 할인이 있으며, 88미니코인 만 소모하면 됩니다. @cfa7a0f 매일 첫 번째 미니 코인을 사용하여 축몽 선물 상자를 열면 무료, 두 번째 반값@n, 세 번째부터 원가를 회복합니다.*n8. 스타 코드 는 68미니코인 를 소비하여 획득할 수 있으며, 미니코인 를 사용하여 선물 상자를 직접 오픈할 수도 있으며, 5회 연속 오픈 시 할인되며, 318미니코인 만 소비하면 됩니다.*n9.별빛 선물 상자 보상 목록 및 확률*n 룩/사용자 정의(영구) 4.799%*n분장/맞춤형(한시) 51.2%*n 조각 꾸미기 15%*n 미니코인 6%*n 미니콩 10%*n 아이템 8%*n 별빛 피부 교환 바우처 초기 확률 0.001%, 행운치가 높을수록 확률이 높고, 행운치가 가득 차면 반드시 획득*n10. 드림빌딩 선물상자 보상 목록 및 확률*n 룩/사용자 정의(영구) 5.102%*n 분장/사용자 정의(한정) 58.297%*n 조각 꾸미기 13%*n 미니코인 2.6%*n 미니콩 10%*n 아이템 11%*n 드림빌딩 스킨쿠폰 초기 확률 0.001%, 행운치가 높을수록 확률이 높고, 행운치가 가득 차면 반드시 획득 *n 이것은 기회 당첨 상품으로 소비자가 구매하거나 이벤트에 참여하면 특정 상품을 얻을 수 있는 것이 아니다]],
