            rule10 = [[1. Hộp quà Tinh Huy: Dùng 1 Mật Ngữ Tinh Huy có thể mở 1 lần, có cơ hội nhận được@cfa7a0fVé đổi skin Tinh Huy@n. *n2. Hộp quà Trúc Mộng: Dùng 1 Mật Ngữ Trúc Mộng có thể mở 1 lần, có cơ hội nhận được@cfa7a0fVé đổi skin Trúc Mộng@n. *n3. Vé đổi skin Tinh Huy, Trúc Mộng có thể đổi lấy skin độc quyền ở Tiệm, Tiệm đổi sẽ được cập nhật thường xuyên, số lượng vé đổi sẽ không bị cài đặt lại. *n4. Khi tích lũy số lần mở hộp quà đạt đến số lượng nhất định, còn có thể nhận thêm thưởng khác, @cfa7a0f số lần tích lũy và thưởng đều sẽ được cài đặt lại vào 23h chủ nhật hàng tuần@n, nhớ nhận thưởng kịp thời nhé! *n5. Mở hộp quà mỗi lần sẽ tăng giá trị may mắn nhất định, giá trị may mắn càng cao, cơ hội nhận được vé đổi cũng càng lớn. Khi giá trị may mắn đã đầy, lần tiếp theo mở hộp quà chắc chắn sẽ nhận được 1 vé đổi, sau khi nhận vé đổi, giá trị may mắn sẽ cài đặt lại về 0 và bắt đầu tích lũy lại. *n6. Khi tài khoản có Mật Ngữ Tinh Huy/Trúc Mộng, mở hộp quà sẽ ưu tiên trừ Mật Ngữ Tinh Huy/Trúc Mộng trước. *n7. Mật Ngữ Trúc Mộng có thể thông qua việc tiêu 20 xu Mini để nhận được, cũng có thể trực tiếp dùng xu Mini để mở hộp quà, mở liên tiếp 5 lần sẽ được giảm giá, chỉ cần tiêu 88 xu Mini; @cfa7a0fMỗi ngày lần đầu mở gói quà Trúc Mộng sẽ được miễn phí, lần thứ 2 sẽ giảm 50%@n, lần thứ 3 trở đi sẽ khôi phục về giá gốc. *n8. Mật Ngữ Tinh Huy có thể thông qua việc tiêu 68 xu Mini để nhận được, cũng có thể trực tiếp dùng xu Mini để mở hộp quà, mở liên tiếp 5 lần sẽ được giảm giá, chỉ cần tiêu 318 xu Mini. *n9. Danh sách và xác suất thưởng của hộp quà Tinh Huy *nSkin/DIY (Vĩnh Viễn) 4.799% *nSkin/DIY (có thời hạn) 51.2% *nMảnh Skin 15% *nXu Mini 6% *nĐậu Mini 10% *nĐạo cụ 8% *nVé đổi skin Tinh Huy Xác suất ban đầu 0.001%, giá trị may mắn càng cao, xác suất nhận càng lớn, giá trị may mắn đầy chắc chắn sẽ nhận *n10. Danh sách và xác suất thưởng của hộp quà Trúc Mộng *nSkin/DIY (Vĩnh Viễn) 5.102% *nSkin/DIY (có thời hạn) 58.297% *nMảnh Skin 13% *nXu Mini 2.6% *nĐậu Mini 10% *nĐạo cụ 11% *nVé đổi skin Trúc Mộng Xác suất ban đầu 0.001%, giá trị may mắn càng cao, xác suất nhận càng lớn, giá trị may mắn đầy chắc chắn sẽ nhận.*n Đây là sản phẩm có cơ hội nhận được, người tiêu dùng mua hoặc tham gia sự kiện không có nghĩa là có thể nhận được sản phẩm đặc biệt này]],
            rule14 = [[1. Confezione regalo Starlight: un Codice stellare può essere utilizzato, e può essere aperto una volta, e c'è la possibilità di ottenere @cfa7a0fVoucher di scambio Starlight Skin@n.*n2. Confezione regalo Dream Building: utilizzare un Gashapon biglietteria, che può essere aperto una volta sola, e avere la possibilità di ottenere @cfa7a0fDream Building Skin Coupon@n.*n3. Voucher di scambio Starlight Skin e Dream Building Skin Coupon possono scambiare la loro pelle esclusiva presso il negozio di scambio. Il negozio di scambio lo aggiornerà di volta in volta e il numero di coupon di scambio non sarà cancellato.*n4. Quando il numero cumulativo di confezioni regalo aperte raggiunge il numero specificato, è possibile ricevere premi aggiuntivi. @cfa7a0f il numero cumulativo e i premi saranno ripristinati alle 0:00 (GMT + 8) ogni lunedì @n. Si prega di ricevere i premi in tempo.*n5. Ogni volta che la scatola regalo viene aperta, un certo numero di valori fortunati saranno aggiunti. Più alto è il valore fortunato, maggiore è la possibilità di ottenere il coupon di scambio. Quando il valore fortunato è pieno, si sarà in grado di ottenere un coupon di scambio la prossima volta che si apre la scatola regalo. Dopo aver ottenuto il coupon di scambio, il valore fortunato sarà ripristinato a 0 e accumulato di nuovo.*n6. Se c'è Codice stellare/Gashapon biglietteria nel conto, Codice stellare/Gashapon biglietteria verrà detratto preferenzialmente all'apertura della confezione regalo.*n7. Gashapon biglietteria può essere ottenuto spendendo 20Mini moneta; È inoltre possibile utilizzare Mini moneta per aprire direttamente la confezione regalo. C'è uno sconto per 5 volte consecutive, e solo 88Mini moneta è necessario @cfa7a0f È libero di aprire la scatola regalo di costruzione da sogno con mini moneta per la prima volta ogni giorno, metà prezzo @n per la seconda volta, e il prezzo originale sarà ripristinato dalla terza volta.*n8. Codice stellare può essere ottenuto spendendo 68Mini moneta, oppure è possibile utilizzare Mini moneta per aprire direttamente la confezione regalo. C'è uno sconto per cinque volte consecutive, solo 318Mini moneta.*n9.Confezione regalo Starlight Belohnungsliste und Wahrscheinlichkeit*n dress up nach Maß (permanent) 4.799%*n kleiden sich hoch und Anpassung (begrenzte Zeit) 51.2%*n dress up fragments 15%*n Mini moneta 6%*n Mini Bohnen 10%*n Requisiten 8%*n Die Anfangswahrscheinlichkeit von Voucher di scambio Starlight Skin beträgt 0.001%. Je höher der Glückswert, desto höher die Wahrscheinlichkeit. Der Glückswert muss ermittelt werden*n10.Confezione regalo Dream Building Belohnungsliste und Wahrscheinlichkeit*n dress up nach Maß (permanent) 5.102%*n dress up und Anpassung (begrenzte Zeit) 58.297%*n Anziehfragmente 13%*n Mini moneta 2.6%*n Mini Bohnen 10%*n Requisiten 11%*n Dream Building Skin Coupon Anfangswahrscheinlichkeit ist 0.001%, je höher der Glückswert, desto höher die Wahrscheinlichkeit, und der Glückswert muss erhalten werden *n Si tratta di un prodotto vincente e l'acquisto o la partecipazione dei consumatori all'attività non significa che possano ottenere un prodotto specifico]],
            rule16 = [[1. Kotak Bintang: Guna 1 Kod Bintang untuk membuka 1 kali, dapatkan @cfa7a0fkupon pertukaran Kulit Bintang@n. *n2、Kotak Impian: Guna 1 Kod Impian untuk membuka 1 kali, dapatkan @cfa7a0fkupon pertukaran Kulit Impian@n. *n3、Kupon pertukaran Kulit Bintang dan Kulit Impian boleh menukar kulit khas di kedai pertukaran. Kedai pertukaran akan dikemas kini dari semasa ke semasa, jumlah kupon pertukaran tidak akan dikosongkan. *n4、 Jumlah keseluruhan membuka kotak mencapai jumlah yang ditentukan, akan menerima ganjaran tambahan. @cfa7a0fJumlah keseluruhan dan ganjaran akan ditetapkan semula pada 0:00 （GMT+8) setiap Isnin@n, sila terima ganjaran tepat masanya. *n5、 Setiap kali membuka kotak, akan menambah Nilai Bertuah. Lebih tinggi Nilai Bertuah, lebih besar peluang untuk mendapat kupon pertukaran. Apabila Nilai Bertuah penuh, kali seterusnya anda membuka kotak, anda akan mendapat kupon pertukaran. Selepas itu, Nilai Bertuah akan ditetapkan semula sebagai kosong dan berkumpul semula. *n6、 Apabila mempunyai kod Bintang/ Impian dalam akaun, membuka kotak akan menolak kod Bintang/ Impian. *n7、 Kod Impian boleh didapati dengan membelanjakan 20 Koin Mini; anda juga boleh terus menggunakan Koin Mini untuk membuka kotak, terdapat diskaun jika pembukaan 5 kali berturut-turut bernilai 88 Koin Mini sahaja; @cfa7a0fKali pertama membuka Kotak Impian adalah percuma setiap hari, harga separuh untuk kali kedua@n, kali ketiga adalah harga asal. *n8、Kod Bintang boleh didapati dengan membelanjakan 68 Koin Mini, anda juga boleh terus menggunakan Koin Mini untuk membuka kotak, terdapat diskaun jika pembukaan 5 kali berturut-turut bernilai 318 Koin Mini sahaja. *n9、 Senarai ganjaran dan kebarangkalian Kotak Bintang *nKulit / Kustom (Kekal) 4.799% *nKulit / Kustom (Masa Terhad) 63.8% *nFragmen Kulit 7.4% *nKoin Mini 6% *nKacang Mini 10% Alat peraga 8% *nKupon pertukaran Kulit Bintang Kebarangkalian awal 0.001%, semakin tinggi Nilai Bertuah, semakin tinggi kebarangkalian, Ni